es not working<\\/a><\\/strong><\\/p>\\n<p>= 2.2 =<\\/p>\\n<p>* New Feature: Image Swap (<a href=\\\"https:\\/\\/www.megamenu.com\\/documentation\\/image-swap\\/\\\">documentation<\\/a>)<br \\/>\\n* New: Add \'Expand all\' behaviour option to accordion menu<br \\/>\\n* Fix: Unable to disable sticky \\\"Expand Background\\\" option once it has been enabled<br \\/>\\n* Improvement: Improve error message when licence activation fails<\\/p>\\n<p>= 2.1.3 =<\\/p>\\n<p>* Fix: Accordion menus not respecting the \'Mobile Menu Behaviour\' setting<\\/p>\\n<p>= 2.1.2 =<\\/p>\\n<p>* New: Add \\\"Menu Toggle - Custom\\\" mobile toggle block<br \\/>\\n* Fix: HTML editor for Replacements not loading in WordPress 5.5<\\/p>\\n<p>= 2.1.1 =<\\/p>\\n<p>* Fix: Tabbed sub menus: Auto select the active\\/parent tab<br \\/>\\n* Fix: Static search box on mobile, impossible to click on the search icon<br \\/>\\n* Fix: PHP warning (logo size in admin)<br \\/>\\n* Fix: Remove custom icon hover styling from mobile (active\\/toggle-on styling remains)<br \\/>\\n* Fix: IE11 JavaScript Error<br \\/>\\n* Fix: Only generate 2x custom icon size if source file is large enough to allow it<br \\/>\\n* New: Add support for megamenu_scripts_in_footer filter<\\/p>\\n<p>= 2.1 =<\\/p>\\n<p>* New: Add sticky options to Menu Locations page<br \\/>\\n* Update: Font Awesome to v5.13.0<br \\/>\\n* Improvement: Ensure the configured logo width and height match the aspect ratio of the source file<br \\/>\\n* Improvement: Add \'mega-svg\' class to SVG logos<br \\/>\\n* Improvement: Styling fixes for WordPress 5.4<br \\/>\\n* Improvement: Add support for megamenu_javascript_handle filter<br \\/>\\n* Improvement: Automatically select the \'Replacements\' tab if a replacement is being used<br \\/>\\n* Improvement: Automatically select the \'Tab content\' tab if a tabbed sub menu is being used<br \\/>\\n* Fix: Accordion arrow position<br \\/>\\n* Fix: PHP 5.2 compatibility<br \\/>\\n* Fix: Sticky menu behaviour when resizing window<br \\/>\\n* Fix: Hover text decoration not applied when Icon Position is set to \\\"Top\\\"<br \\/>\\n* Fix: Tab content positioning when sub menu effect is set to Slide and dynamic sub menu widths are being used<\\/p>\\n<p>= 2.0.1 =<\\/p>\\n<p>* Fix: PHP Warning<br \\/>\\n* Fix: Fonts on tabbed sub menus when Font Family is set to \\\"Theme Default\\\"<\\/p>\\n<p>= 2.0 =<\\/p>\\n<p>* New Feature: Menu Item Badges<br \\/>\\n* Improvement: Add megamenu_licence_key_field_type filter<br \\/>\\n* Fix: Sticky menu logo transition when menu becomes unstuck (i.e. when user scrolls back to top of page)<\\/p>\\n<p>= 1.9.4 =<\\/p>\\n<p>* Fix: Smush Lazy Loading on Logo Toggle Block (use double quotes instead of single quotes for logo attributes)<\\/p>\\n<p>= 1.9.3 =<\\/p>\\n<p>* Fix: Static search box closes when page background is clicked<\\/p>\\n<p>= 1.9.2 =<\\/p>\\n<p>* Fix: Sticky Mobile Menu position in Vantage theme<br \\/>\\n* Fix: Mobile Toggle search box padding<br \\/>\\n* Fix: Mobile accordion menu when tabbed sub menus are used<br \\/>\\n* Fix: Allow double quotes in custom font names<br \\/>\\n* Fix: Sticky menu does not work when minification plugins strip zero value attributes<br \\/>\\n* Fix: Hover transitions on custom icons<br \\/>\\n* Fix: Custom icon transition<br \\/>\\n* Improvement: Refactor expanding search box JavaScript<br \\/>\\n* Improvement: Close search box if page background is clicked<br \\/>\\n* Improvement: Allow custom icons to only appear on hover<br \\/>\\n* Improvement: Add title attribute to icon toggle blocks<br \\/>\\n* Improvement: Add support for MEGAMENU_SCRIPTS_IN_FOOTER option<\\/p>\\n<p>= 1.9.1 =<\\/p>\\n<p>* Improvement: Add megamenu_accordion_parent_classes filter<br \\/>\\n* Fix: Content below menu \'bounces\' when unsticking menu<\\/p>\\n<p>= 1.9 =<\\/p>\\n<p>* Compatibility with Max Mega Menu 2.7: Off canvas mobile menu positioning when sticky menu and \\\"Hide until scroll up\\\" has been enabled<br \\/>\\n* Compatibility with Max Mega Menu 2.7: Tabbed sub menu height when \\\"Collapse children\\\" option has been enabled for sub menus within the tabs<br \\/>\\n* Fix: Tabs border height when sub menu has top border<br \\/>\\n* Fix: Style overrides (Font Weight) Do not apply \\\"font-weight: normal\\\" to :before icon<br \\/>\\n* Fix: Sticky menu height when accordion sub menu is open and taller than the height of the window<\\/p>\\n<p>= 1.8 =<\\/p>\\n<p>* New: Add support for Font Awesome 5<br \\/>\\n* New: Add option to dequeue Font Awesome and Genericons<br \\/>\\n* Improvement: Add title attributes to icons in icon selector<br \\/>\\n* Improvement: Use core version of CodeMirror<br \\/>\\n* Fix: Tab focus on search replacement<br \\/>\\n* Fix: Ensure custom icons are centrally positioned within sub menus on mobile<br \\/>\\n* Fix: Open search toggle block on focus<br \\/>\\n* Fix: Add width: auto to logo toggle block images<br \\/>\\n* Fix: HTML replacement when Replacement HTML is exactly equal to the Menu Item Title<br \\/>\\n* Change: Use \'wp_get_attachment_url\' (instead of wp_upload_dir) to get custom icon URLs<\\/p>\\n<p>= 1.7.1 =<\\/p>\\n<p>* New: \\\"Sticky on desktop\\\" option added, making it possible to have a sticky menu on mobile only<br \\/>\\n* New: \\\"Sticky: Expand on Mobile\\\" option added, making it possible to differentiate between desktop and mobile when expanding the sticky menu<br \\/>\\n* Improvement: Validate logo width and height settings<br \\/>\\n* Fix: Allow shortcodes in Search toggle block placeholder<br \\/>\\n* Fix: Account for top and bottom border widths when setting heights for tabbed sub menus<br \\/>\\n* Fix: Output \\\"Title Attribute\\\" field on logo menu items<br \\/>\\n* Fix: Hide arrow on accordion menus, when sub menu is open<br \\/>\\n* Fix: Style overrides: Apply hover styling to \'mega-current-page-ancestor\' items<br \\/>\\n* Fix: Transition sticky menu height when menu becomes unstuck<br \\/>\\n* Fix: Style overrides: Apply icon hover color when sub menu is open<br \\/>\\n* Improvement: Update plugin updater class<\\/p>\\n<p>= 1.7 =<\\/p>\\n<p>Update Instructions: Update Max Mega Menu (free) to v2.5+. Update Max Mega Menu Pro. Go to Mega Menu &gt; Tools and Clear the CSS Cache.<\\/p>\\n<p>* New: Make arrow indicators clickable on Accordion menus<br \\/>\\n* Change: Apply sticky \\\"hide until scroll up\\\" option to mobile menus (only when the mobile menu is collapsed)<br \\/>\\n* Improvement: Validate custom styling options - make sure text inputs are valid before submitting form<br \\/>\\n* Fix: \\\"Hide arrow\\\" on tab menu items not working<br \\/>\\n* Fix: Tab menu heights when using jQuery selector to set sub menu width<br \\/>\\n* Fix: Ensure menu theme CSS can still compile even when leaving toggle block options empty<br \\/>\\n* Fix: Elementor header builder fails to load when using WooCommerce replacement type\\/shortcode<br \\/>\\n* Fix: Auto expand accordion sub menus when menu item has \'mega-current-menu-parent\' class<br \\/>\\n* Fix: Do not apply 600px default sub menu width on vertical menus on mobile<\\/p>\\n<p>= 1.6.6 =<\\/p>\\n<p>* Fix: Mobile menu jumping when Sticky is enabled and Expand Background is set to false<br \\/>\\n* Fix: PHP Notice when roles restriction has been set to \\\"By Role\\\" but no roles have been selected<br \\/>\\n* Fix: Tab positioning when mega menu sub menu inner width has been set to a jQuery\\/CSS selector<br \\/>\\n* Fix: Accessibility: Add aria-label attribute to search replacement &amp; search toggle block<br \\/>\\n* Fix: Change the default value of the logo toggle block max height to 40px (instead of 100%)<br \\/>\\n* Fix: Adjustments to tabbed menu JavaScript<br \\/>\\n* Improvement: Use set_url_scheme() on logo block URL to work around incorrectly configured databases when site has switched to use HTTPS<br \\/>\\n* Improvement: Remove reference to Toggle Block IDs in CSS, only use the toggle block class<br \\/>\\n* Improvement: Update list of Google Fonts<br \\/>\\n* Improvement: Styling for search replacement in vertical\\/accordion menus updated<br \\/>\\n* Change: Stick menu on document.load() rather than document.ready() (to allow dashicons to load before sticking the menu)<\\/p>\\n<p>= 1.6.5 =<\\/p>\\n<p>* Fix: Potential residual styling on search toggle block<br \\/>\\n* Fix: Media File Selector missing from logo\\/icon toggle block<br \\/>\\n* Fix: Only apply srcset to logo images if 2x size exists<br \\/>\\n* Improvement: Sticky menu: Add Support for \\\"Bottom Admin Bar\\\" plugin<br \\/>\\n* Improvement: Only submit search form when text is entered into the search field (static search)<br \\/>\\n* Improvement: For clarity, hide \\\"Hide Until Search Up\\\" related sticky options until \\\"Hide Until Search Up\\\" option has been selected<\\/p>\\n<p>= 1.6.4 =<\\/p>\\n<p>13 November 2017<\\/p>\\n<p>* Fix: WordPress 4.9 compatibility. JavaScript error\\/incompatibility with the HTML Editor in the \\\"Replacements\\\" tab. Introduced due to an update in core WordPress 4.9<br \\/>\\n* Fix: Style override font color when sub menu is open<br \\/>\\n* Fix: Add WPML language input to search form<br \\/>\\n* Fix: Logo max height in mobile menu<br \\/>\\n* Fix: Stop vertical sticky menus from covering page content and making links\\/text inaccessible<br \\/>\\n* Fix: Stop \\\"hide until scroll up\\\" sticky functionality being applied to mobile menu<br \\/>\\n* Fix: Roles: Remove sub menu arrow indicator when children have been removed from the menu due to role restrictions<br \\/>\\n* Fix: Replace jQuery \'live\' with \'on\'<br \\/>\\n* New: Custom Icon Size for mobile menu setting added<br \\/>\\n* New: Sticky menu height option in theme editor<br \\/>\\n* New: Search replacement search icon can now be selected from the menu item icon screen<br \\/>\\n* New: Enable Grid Layout for tabbed sub menus (requires Max Mega Menu 2.4)<br \\/>\\n* Improvement: Allow shortcodes in toggle blo